import React from "react";

const table = props => {
  console.log("size of the object", props.moves.length);
  const data = [];

  const finalData = [];
  console.log("props.moves", props.moves);
  for (let key in props.moves) {
    data.push(props.moves[key]);
  }
  console.log("the pushed data is", data);
  data.map(el => {
    for (let key in el.data.quick_moves) {
      finalData.push({ quick_moves: el.data.quick_moves[key] });
    }
    console.log("data inside the map is", data);
  });
  console.log(finalData.quick_moves);
  return (
    <div>
      <table>
        <tr>
          <th>Stats</th>
          <th>Move 1</th>
          <th>Move 2</th>
          {/* //need to check how many quick moves it has */}
          <th>Move 3</th>
        </tr>
        <tbody>
          <tr>
            <td>EPS</td>
            <td>5</td>
            <td>8</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
